local Translations = {
    ["由小云汉化"] = "由张硕汉化"
}

local function translateText(obj)
    if obj:IsA("TextLabel") or obj:IsA("TextButton") or obj:IsA("TextBox") then
        local text = obj.Text
        
        if Translations[text] then
            obj.Text = Translations[text]
            return true
        end
        
        for eng, chi in pairs(Translations) do
            if text:find(eng, 1, true) then
                local translated = text:gsub(eng, chi, 1)
                if translated ~= text then
                    obj.Text = translated
                    return true
                end
            end
        end
        
        for eng, chi in pairs(Translations) do
            if text:lower() == eng:lower() then
                obj.Text = chi
                return true
            end
        end
    end
    return false
end

local function setupTextListener(obj)
    if obj:IsA("TextLabel") or obj:IsA("TextButton") or obj:IsA("TextBox") then
        if not obj:FindFirstChild("TranslationListener") then
            obj:GetPropertyChangedSignal("Text"):Connect(function()
                translateText(obj)
            end)            
            local marker = Instance.new("BoolValue")
            marker.Name = "TranslationListener"
            marker.Parent = obj
        end
        
        return translateText(obj)
    end
    return false
end

local function main()    
    local count = 0
    for _, obj in ipairs(game:GetDescendants()) do
        if setupTextListener(obj) then
            count = count + 1
        end
    end
    
    game.DescendantAdded:Connect(function(obj)
        setupTextListener(obj)
    end)
    
end

